import React, { Component } from "react";
class GoogleImage extends Component {
render() {
return (
<div>

<img style={{"maxHeight":"80%","maxWidth":"90%"}} src="./image/1.jpg" alt="Flowers in Chania"/>
<img src="./image/2.jpg" alt="Flowers in Chania"/>
<img src="./image/3.jfif" alt="Flowers in Chania"/>
<img src="./image/4.jfif" alt="Flowers in Chania"/>


</div>
);
}
}
export default GoogleImage;
